import React, { Component } from 'react';


class App extends Component {

  constructor() {
    super();    
  }

  render (){
    return (
      <div className="App">
        <nav className="orange darken-4">
          <div className="container">
            <div className="nav-wrapper">
              <a href="#" className="brand-logo">Ligas Burocraticas Walnic</a>
            </div>
          </div>
        </nav>
      </div>
    );
  }
}

export default App;
